import { BrowserRouter,Routes,Route } from "react-router-dom";
import Counter from "./counter";
import Aboutme from "./aboutme";


export default function Navbar() {
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Counter/>}/>
                <Route path="/about" element={<Aboutme/>}/>
            </Routes>
        </BrowserRouter>
    ); 
    
}
